const App = () => {
  const [items, setItems] = useState(data.slice(0,10));
  const [page, setPage] = useState(1);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (loading) return;
    if (items.length >= 10) return;
    setItems(data.slice(page*10, page*10+10));
    setLoading(true);
    setPage(page + 1);
    setLoading(false);
  }, [loading, page, items]);

  return (
    <div className="App" onScroll={() => setLoading(false)}>
      {items.map((ele, idx) => (
        <div style={{ border: "1px solid black" }} key={idx + idx}>
          <h3>{ele.name}</h3>
          <h4>{ele.city}</h4>
          <h5>{ele.pincode}</h5>
          <h5>{ele.country}</h5>
        </div>
      ))}
      {loading && <div>Loading...</div>}
    </div>
  );
};

export default App;
